To mark the 50 year anniversary of Motown, a compilation of some of the iconic record 
label's greatest names filmed live in the BBC studios. Visitors from Hitsville USA over 
the years have included Smokey Robinson and the Miracles, Diana Ross and the Supremes, 
the Temptations, Stevie Wonder, the Four Tops and the Jackson 5.

